function query() {
    var url = this.url;
    var searchString = this.get("SearchString").textString
    var searchParams = searchString ? searchString.split(':') : null;
    var search = '';
    if (searchParams && searchParams[0]) {
        search = "?$filter=substringof('" + searchParams[1] +
            "', " + searchParams[0] + ") eq true";
    }
    if (this.queryString) {
        url += '/' + this.queryString + search;
    }
    this.doQuery(url);
}

