function morphMenuItems() {
    var items = $super();
    var that = this;
    items.push(['set parts space name', function(evt) {
        $world.prompt('Parts space for tile: ', function(input) {
            if (!input || input != '') that.partsSpaceName = input;
        }, that.partsSpaceName);
    }]);
    items.push(['set part name', function(evt) {
        $world.prompt('Part name for tile: ', function(input) {
            if (!input || input != '') that.partName = input;
        }, that.partName);
    }]);
    items.push(['set URL', function(evt) {
        $world.prompt('URL: ', function(input) {
            if (!input || input != '') that.url = input;
        }, that.url);
    }]);
    items.push(['set query string', function(evt) {
        $world.prompt('Query string: ', function(input) {
            if (!input || input != '') that.queryString = input;
        }, that.queryString);
    }]);
    items.push(['set number of items', function(evt) {
        $world.prompt('Number of items: ', function(input) {
            if (!input || input != '') that.numItems = parseInt(input);
        }, that.numItems);
    }]);
    items.push(['inspect query results', (function() {
        this.withItemsDo(function(items) {
            inspect(items);
        });
    }).bind(this)]);
    return items;
}

