function withItemsDo(callback) {
    this.query();
    var result = this.lastResult; 
    if (result.error) {
        inspect(result);
        return;
    }
    if (this.numItems) {
        result = result.slice(0, this.numItems);
    }
    callback(result);
    if (this.customCallback) {
        result.forEach(function (each) {
            this.customCallback(each);
        }.bind(this)); 
    }
}

