function doQuery(serviceURL) {
    if ((typeof serviceURL != 'string') && !(serviceURL instanceof String)) {
        alert('Please set a serviceURL as parameter!');
        return;
    }

    var query, lastIdx = serviceURL.lastIndexOf('.svc');
    if (lastIdx >= 0) {
        query = serviceURL.substring(lastIdx + 4);
        serviceURL = serviceURL.substring(0, lastIdx + 4);
    } else {
        query = '/';
    }

    var s = new Sys.Data.OpenDataServiceProxy(serviceURL);

    var self = this;
    withLayers([Microsoft2LKLayer], function() {
        self.lastQuery = query.substring(1);
        s.query(query, self.onSuccess.bind(self), self.onFailure.bind(self));
    });
}
